Defines the observation per player provided by the environment.
Each dict member will contain its expected structure and shape. E.g.: for Kuhn Poker {"info_state": (6,), "legal_actions": (2,), "current_player": (), "serialized_state": ()}
Returns: A specification dict describing the observation fields and shapes.

Defines per player action specifications.
Specifications include action boundaries and their data type. E.g.: for Kuhn Poker {"num_actions": 2, "min": 0, "max":1, "dtype": int}
Returns: A specification dict containing per player action properties.
